import React from "react";
import styled from "styled-components";
import LogoYt from "../img/logo.png";
import HomeIcon from '@mui/icons-material/Home';

const Container = styled.div`
    flex: 1;
    background-color: #202020;
    height: 100vh;
    color: #fff;
    font-size:14px;
`;

const Wrapper = styled.div`
    padding: 15px 20px;
`;

const Logo = styled.div`
display:flex;
align-items:center;
gap:5px;
font-weight:bold;
margin-bottom:15px;
`;

const Img = styled.img`
    height:25px;
`;

const Item = styled.div`
    display:flex;
    align-items:center;
    gap : 15px;
    cursor:pointer;
`;

const Menu = () => {
    return (
        <Container>
            <Wrapper>
                <Logo>
                    <Img src={LogoYt}/>RaoulTube

                </Logo>
                <Item>
                <HomeIcon/>Home
                </Item>
                </Wrapper>
        </Container>
    );
};

export default Menu;
